INSERT INTO `tbl_email_template` VALUES ('1', 'EMAIL_ORDER_TO_CLIENT', 'ORDER CONFIRMATION Order #%ORDER%', 'Dear %CUSTOMER% \n\nThank you for the recent order #%ORDER%  you made on %DATE%. This is a confirmation that your order has been successfully received and all details are correct. Please review the order and confirm as soon as \npossible using the approve/ confirm button and optional signature pad.You may use the upload button to upload a ORDER or REVISED ORDER if needed. When we receive this, we can move the order into production.\nAttached to this message is a copy of your order, which also includes the details of your order. \n\nPRINTMATE values your business and is continuously looking for ways to better satisfy their customers. Please do share with us if there is a way we can serve you better.', 'Email Order to client', '1', '0', '1');
INSERT INTO `tbl_email_template` VALUES ('2', 'EMAIL_ORDER_TO_CLIENT_REVISED', 'REVISED ORDER CONFIRMATION Order #%ORDER%', 'Dear %CUSTOMER% \n\nThank you for the recent order #%ORDER%  you made on %DATE%. This is an confirmation that your order has been successfully received. In reviewing the details, we have made revisions to certain items. Please review the order and confirm as soon as \npossible using the approve/ confirm button and optional signature pad.You may use the upload button to upload a ORDER or REVISED ORDER if needed. When we receive this, we can move the order into production.\nAttached to this message is a copy of your order, which also includes the details of your order. \n\nPRINTMATE values your business and is continuously looking for ways to better satisfy their customers. Please do share with us if there is a way we can serve you better.', 'Email Order to client', '1', '0', '1');
INSERT INTO `tbl_email_template` VALUES ('3', 'EMAIL_ORDER_TO_CLIENT_SHORT', 'SHORT FORM ORDER CONFIRMATION #%ORDER%', 'Hello %CUSTOMER%,\r\n\r\nThank you for the recent order #%ORDER%  made on %DATE%. Your price list and delivery dates have all been confirmed.  Any  revisions may be uploaded using the UPLOAD button or via email.  By clicking confirm your order will immediately move into production.', 'Email Order to Client | Short version', '1', '0', '1');
INSERT INTO `tbl_email_template` VALUES ('4', 'EMAIL_ORDER_TO_CLIENT_REVISED_SHORT', 'SHORT FORM ORDER CONFIRMATION : REVISED %ORDER%', 'Hello %CUSTOMER%,\r\n\r\nThank you for the recent order #%ORDER%  made on %DATE%.   This is a revised order confirmation. Please review the revised order and confirm as soon as possible.   Any further revisions may be uploaded using the UPLOAD button or communicated via email.  By clicking confirm & uploading your revised PURCHASE ORDER your order will immediately move into production.', 'Email Order to Client Revised | Short Version', '1', '0', '1');
